import React from 'react';
import '../index.css';

function ImagePopup(props) {
  return (
  <div className={`popup popup_open-card`} >
    <div className="popup__element">
      <img className="popup__image" src="https://images.unsplash.com/photo-1502489352690-20d1494ac469?ixlib=rb-4.0.3&ixid=MnwxMjA3fDB8MHxwaG90by1wYWdlfHx8fGVufDB8fHx8&auto=format&fit=crop&w=715&q=80" alt="фото"/>
      <button type="button" aria-label="Закрыть" className="popup__close" onClick={props.onClose}></button>
      <h2 className="popup__text">Фото</h2>
    </div>
  </div>
  );
}

export default ImagePopup;
